import React, { useState, useEffect } from 'react';
import axios from 'axios';

const TPSoloIDS = () => {
  const [todosIds, setTodosIds] = useState([]);

  useEffect(() => {
    const fetchTodosIds = async () => {
      try {
        const response = await axios.get('http://jsonplaceholder.typicode.com/todos');
        const todos = response.data;
        const todosIds = todos.map(todo => todo.id);
        setTodosIds(todosIds);
      } catch (error) {
        console.error('Error fetching todos IDs:', error);
      }
    };

    fetchTodosIds();
  }, []);

  return (
    <div>
      <style>
        {`
          .todos-table {
            width: 100%;
            border-collapse: collapse;
          }

          .todos-table th, .todos-table td {
            border: 1px solid #dddddd;
            padding: 8px;
            text-align: left;
          }

          .todos-table th {
            background-color: #f2f2f2;
          }
        `}
      </style>
      <h2>Lista de todos los pendientes (solo IDs)</h2>
      <table className="todos-table">
        <thead>
          <tr>
            <th>ID</th>
          </tr>
        </thead>
        <tbody>
          {todosIds.map(todoId => (
            <tr key={todoId}>
              <td>{todoId}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default TPSoloIDS;
